import{_ as e,c as a,o as t,a4 as r}from"./chunks/framework.DBIahkuf.js";const A=JSON.parse('{"title":"DALL·E 2 简介和相关网址工具","description":"","frontmatter":{},"headers":[],"relativePath":"Document/AI绘画工具/DALL-E 2 AI绘画工具/DALL-E 2 简介和相关网址工具.md","filePath":"Document/AI绘画工具/DALL-E 2 AI绘画工具/DALL-E 2 简介和相关网址工具.md","lastUpdated":1708941732000}'),o={name:"Document/AI绘画工具/DALL-E 2 AI绘画工具/DALL-E 2 简介和相关网址工具.md"},n=r('<h1 id="dall·e-2-简介和相关网址工具" tabindex="-1">DALL·E 2 简介和相关网址工具 <a class="header-anchor" href="#dall·e-2-简介和相关网址工具" aria-label="Permalink to &quot;DALL·E 2 简介和相关网址工具&quot;">​</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>OpenAI 公司产品 DALLE-2</p><p>一种利用人工智能的免费开源图片生成器称为 Dall-E 2。用户只需将请求放入提供的框中，Dall-E 2 会处理其余的工作以生成可以下载的照片。即使添加了规格和各种特殊需求和说明，Dall-E 2 仍然可以创建精美的图像。</p><p>DALL-E 2 是一种基于语言的人工智能图像生成器，可以根据文本提示创建高质量的图像和艺术作品。它使用 CLIP、先验和 unCLIP 模型来生成图像，其质量取决于文本提示的具体性。DALL-E 2 为创造和消费艺术开辟了新的可能性和挑战，虽然它有可能重新定义艺术，但也有可能影响创意产业。围绕 DALL-E 2 系统的讨论一直处于两极分化的状态，甚至在其推出了几个月后依旧如此。</p><p>有用户认为这是一项可以重新定义艺术的突破性创新，而批评者则将其视为人工智能图像生成器给创意产业带来厄运的开始。</p><p><a href="https://www.5bei.cn/repair-picture-with-mouse.html" target="_blank" rel="noreferrer">DALL·E 2 (5bei.cn)</a></p><h2 id="相关网址" tabindex="-1">相关网址 <a class="header-anchor" href="#相关网址" aria-label="Permalink to &quot;相关网址&quot;">​</a></h2><p>官网：<a href="https://openai.com/dall-e-2" target="_blank" rel="noreferrer">DALL·E 2 (openai.com)</a></p><p>图片扩展工具地址：<a href="https://labs.openai.com" target="_blank" rel="noreferrer">https://labs.openai.com</a></p><p>选定目标图-&gt;DallE 画背景 -&gt; 添加元素(像 PS 扩展(延展)图片一样的手法)-&gt;补充生成一张完整的图</p><p>在 newbing 中的生成画像图像就是用 DALL·E 2</p>',12),l=[n];function p(_,L,c,i,s,h){return t(),a("div",null,l)}const D=e(o,[["render",p]]);export{A as __pageData,D as default};
